_code";s:11:"CEvUC3mj46q";}i:197;a:1:{s:12:"created_time";i:1599275430;}i:198;a:1:{s:7:"caption";s:1425:"Onions make us cry because Propanethial-S-Oxide (C3H6OS) interacts with the Lacrimal fluid present in your eyes to form Sulfuric Acid. Onions absorb a lot of Sulfur from the ground and when you cut an onion, you’re breaking the cell structure, this allows Amino Acid Sulfoxides to form Sulfenic Acid (RSOH). Now, a special enzyme called Lachrymatory-Factor Synthase is released, which reacts with the Sulfenic Acid to create a chemical known as Propanethial-S-Oxide (C3H6OS). This chemical is volatile, which means it easily evaporates at normal temperature to create a gas. The gas rises to meet with our eyes and reacts with our Lacrimal fluid.
There are three types of tears including Emotional (which is for crying), Basal (which is always present), and Reflexive (which acts to remove an irritant). Tears contain Water, Mucus, Oil, Nutrients, and Antibacterial Lysozymes. Your Reflexive tears reacts with Propanethial-S-Oxide and in rearranging again, Sulfuric Acid is formed. Sulfuric Acid (H2SO4) is made from Sulfate and not Sulfur since the chemical does not have “Hydro” in it. Also, the chemical formula has Oxygen, making it Polyatomic. It is also not made from Sulfite because Sulfite would be called Sulfurous acid. The acid gives a burning sensation and more Reflexive tears are filling the eye until there is no more room, which results in “Crying”.
